std::ostream &operator<<(std::ostream &o, const __int128 &x)
{
    if (x < 0)
        return o << "-" << -x;
    if (x < 10)
        return o << (char) (x + '0');
    return o << x / 10 << (char) (x % 10 + '0');
}

i128 ext_gcd(i128 x, i128 y, i128 &a, i128 &b)
{
    if (y == 0) {
        a = 1, b = 0;
        return x;
    }
    i128 ans = ext_gcd(y, x % y, b, a);
    b -= x / y * a;
    return ans;
}

